import React from "react";
import BlogCard from "./BlogCard";
export default function BlogCradList({ data }) {
  console.log(data);
  return (
    <>
      {data.map((d) => (
        <>
          <BlogCard
            key={d.uid}
            img={d.data.image.url}
            postDate={d.public_date}
          />
          <BlogCard key={d.uid} img={d.data.image.url} />
          <BlogCard key={d.uid} img={d.data.image.url} />
          <BlogCard key={d.uid} img={d.data.image.url} />
          <BlogCard key={d.uid} img={d.data.image.url} />
          <BlogCard key={d.uid} img={d.data.image.url} />
          <BlogCard key={d.uid} img={d.data.image.url} />
          <BlogCard key={d.uid} img={d.data.image.url} />
        </>
      ))}
    </>
  );
}
